import { Network, Cpu } from "lucide-react";
import SubjectPage from "./SubjectPage";

const ComputerNetworks = () => {
  const topics = [
    { name: "OSI & TCP/IP", desc: "Understand OSI layers, protocols, and TCP/IP stack.", icon: <Network className="w-10 h-10 text-purple-600"/>, path: "/placement-prep/core-subjects/cn/osi", color: "from-purple-100 to-purple-50" },
    { name: "Routing & Switching", desc: "Learn routing algorithms, IP addressing, and subnetting.", icon: <Cpu className="w-10 h-10 text-blue-600"/>, path: "/placement-prep/core-subjects/cn/routing", color: "from-blue-100 to-blue-50" },
  ];

  return (
    <SubjectPage
      title="Computer Networks Preparation"
      description="Master networking fundamentals: TCP/IP, OSI, and routing protocols."
      topics={topics}
    />
  );
};

export default ComputerNetworks;
